On September 6, 2011, journalist Turki al-Dakhil hosted Joseph Braude on his Al-Arabiya talk show, "Spotlights."  Among the topics they discussed were the concepts "the rule of law" and "the culture of lawfulness."  For more information, follow @josephbraude or browse www.josephbraude.com.

